import React,{useState, useEffect} from 'react'
import { DataGrid } from '@material-ui/data-grid';
import { DeleteOutline,Edit } from '@material-ui/icons';
import { Link} from 'react-router-dom'
import './dificultList.css'
const axios = require('axios');

export default function DificultList() {

    const [dificults, setDificults] = useState([])

    useEffect(() =>{

            axios.get('http://localhost:4500/api/dificultad')
            .then(res => {
                setDificults(res.data)
            })
            .catch((err) => {
                console.log(err)
            })
    },[setDificults])

    const columns = [
        { 
            field: 'id', 
            headerName: 'ID', 
            width: 90 
        },

        {
          field: 'nombre',
          headerName: 'Nombre',
          width: 200,
          editable: true,
        },

          {
            field: 'edit',
            headerName: 'Editar',
            width: 150,
            renderCell: (params)=>{
                return(
                    <>
                    <Link to={"/dificult/"+params.row.id} className='linkListEdit'>
                        <Edit className='dificultListEdit' />
                    </Link>

                    </>
                )
            }
          },
          {
            field: 'delete',
            headerName: 'Eliminar',
            width: 150,
            renderCell: (params)=>{
                return(
                    <>
                    <Link to={"/dificult/"+params.row.id}>
                        <DeleteOutline className='dificultListDelete'/>
                    </Link>
                    </>
                )
            }
          }
      ];

      const rows = [
        { id: 1, nombre: 'facil' },
        { id: 2, nombre: 'intermedio' },
        { id: 3, nombre: 'avanzado' },
      ];

    return (
        <div className='dificultList'>
            <DataGrid
                rows={rows}
                columns={columns}
                pageSize={5}
                checkboxSelection
                disableSelectionOnClick
            />
        </div>
    )
}
